create PROCEDURE [dbo].[SaveUpdateColors]  
(
@ColorName NVARCHAR(150),
@ColorID INT = NULL,
 @DataOperationType int



)
AS
BEGIN
	


	IF(@DataOperationType=1)
	BEGIN

	

		INSERT INTO Colors(ColorName,CreatedOn)
		VALUES(@ColorName, GETDATE());

	END

	ELSE IF(@DataOperationType=2 AND @ColorID IS NOT NULL)

	BEGIN
		UPDATE TOP(1) Colors
		SET ColorName=@ColorName WHERE ColorID=@ColorID
	END

END
