create PROCEDURE [dbo].[SP_GetContactUsList]   
(



@CustomerName NVARCHAR(100)='',
@CustomerMessage NVARCHAR(100)=''


)
AS
BEGIN
	


	select * from contactUs DP


	where 
	(DP.CustomerName  LIKE IIF(@CustomerName IS NULL OR @CustomerName = '', DP.CustomerName, '%'+@CustomerName+ '%'))
	and (DP.CustomerMessage  LIKE IIF(@CustomerMessage IS NULL OR @CustomerMessage = '', DP.CustomerMessage, '%'+@CustomerMessage+ '%'))


	ORDER BY  DP.ContactUsID  DESC

END
