CREATE PROCEDURE [dbo].[SP_GetCustomerOrderBookingList]   
(

  @CustomerID INT
 
)
AS
BEGIN
	

	SELECT DISTINCT DP.* , MK.MakeName , MD.ModelName, CLR.ColorName , CL.LocationName, FT.FuelType, TS.Seats , ORDMain.OrderID
	FROM Products DP
	INNER JOIN OrdersDetail ORDET ON ORDET.ProductID=DP.ProductID
	INNER JOIN Orders ORDMain ON ORDMain.OrderID=ORDET.OrderID
	LEFT JOIN Makes MK ON DP.MakeID=MK.MakeID
	LEFT JOIN Models MD ON DP.ModelID=MD.ModelID
	LEFT JOIN CarsLocations CL ON DP.LocationID=CL.LocationID
	LEFT JOIN Colors CLR ON DP.ColorID=CLR.ColorID
	LEFT JOIN FuelTypes FT ON DP.FuelTypeID=FT.FuelTypeID
	LEFT JOIN TotalSeats TS ON DP.SeatNumberID=TS.SeatNumberID
	
	WHERE ORDMain.CustomerID=@CustomerID
	ORDER BY  DP.ProductID  DESC

END
GO
