CREATE PROCEDURE [dbo].[SP_GetDashboardOrderStatusesCount]   

AS
BEGIN

	;WITH CTE_Orders AS (
		select distinct ord.OrderID , isnull(ST.StatusID,1) as StatusID
	from orders ord 



	outer apply(
	select top 1 os.StatusID, st.StatusName from OrderStatuses os
	inner join Statuses st on os.StatusID=st.StatusID
	where os.OrderID=ord.OrderID and os.IsActive=1
	order by os.OrderStatusID desc
	)st
	)
	select distinct st.StatusID,  sts.StatusName ,COUNT(ST.StatusID)OVER(PARTITION BY ST.STATUSID) as TotalOrders
	
	from CTE_Orders ST
	inner join Statuses sts on sts.StatusID=st.StatusID
	
	

END
GO
