CREATE PROCEDURE [dbo].[SP_GetOrderDetailsList]  
( 

  @OrderID INT 
  )
AS
BEGIN
	
	select distinct ORD.OrderID, ORD.ProductID, ORD.Quantity, ORD.Price, ORD.CreatedOn , CRL.LocationName
	,usr.FullName as CustomerFullName, usr.EmailAddress as CustomerEmail , usr.Phone as CustomerPhone , ORM.CustomerAddress	
	,ORM.DeliveryDate, ORM.TotalAmount,PR.ProductName , PR.Description, MK.MakeName , MDL.ModelName
	from OrdersDetail ORD
	INNER JOIN Orders ORM ON ORD.OrderID=ORM.OrderID
	inner join Users usr on ORM.CustomerID=usr.UserID
	INNER JOIN Products PR ON ORD.ProductID=PR.ProductID
	LEFT JOIN Makes MK ON PR.MakeID=MK.MakeID
	LEFT JOIN Models MDL ON PR.ModelID=MDL.ModelID
	LEFT JOIN CarsLocations CRL ON PR.LocationID=CRL.LocationID

	where ord.OrderID=@OrderID


END
GO
