CREATE PROCEDURE [dbo].[SP_GetOrdersList]   
(

  @OrderID INT = NULL, 
  @CustomerEmail NVARCHAR(100)='',
  @StatusID INT = NULL


)
AS
BEGIN
	



	select distinct ord.OrderID, ord.CustomerID, ord.DeliveryDate, ord.TotalAmount, ord.CreatedOn
	, isnull(st.StatusID , 1) as StatusID, isnull(st.StatusName ,'Active') StatusName, count(ORDet.OrderID) over() as TotalItems
	,usr.FullName as CustomerFullName, usr.EmailAddress as CustomerEmail , usr.Phone as CustomerPhone , ord.CustomerAddress
	from orders ord 

	inner join OrdersDetail ORDet on ord.OrderID=ORDet.OrderID
	inner join Users usr on ord.CustomerID=usr.UserID

	outer apply(
	select top 1 os.StatusID, st.StatusName from OrderStatuses os
	inner join Statuses st on os.StatusID=st.StatusID
	where os.OrderID=ord.OrderID and os.IsActive=1
	order by os.OrderStatusID desc
	)st

	WHERE ord.OrderID IS NOT NULL 
	AND (ord.OrderID  = IIF(@OrderID IS NULL OR @OrderID = '', ord.OrderID, @OrderID))
	AND (isnull(ord.CustomerEmail,0)  LIKE IIF(@CustomerEmail IS NULL OR @CustomerEmail = '', isnull(ord.CustomerEmail,0), '%'+@CustomerEmail+ '%'))
	AND ( isnull(st.StatusID ,0) = IIF(@StatusID IS NULL OR @StatusID = 0,isnull(st.StatusID ,0) , @StatusID))

	ORDER BY  ord.OrderID  DESC

END
GO
