CREATE PROCEDURE [dbo].[SP_GetProductsList]   
(

  @ProductID INT = NULL, 
  @ProductName NVARCHAR(100)='',
  @MakeID INT = NULL
)
AS
BEGIN
	
	SELECT  DP.* ,MK.MakeName , MDL.ModelName, clr.ColorName
	FROM Products DP
	LEFT JOIN Makes mk ON DP.MakeID=mk.MakeID
	LEFT JOIN modelS MDL ON DP.ModelID=MDL.ModelID
	LEFT JOIN Colors CLR ON DP.ColorID=CLR.ColorID
	WHERE DP.ProductID IS NOT NULL 
	AND (DP.ProductID  = IIF(@ProductID IS NULL OR @ProductID = '', DP.ProductID, @ProductID))
	AND (DP.ProductName  LIKE IIF(@ProductName IS NULL OR @ProductName = '', DP.ProductName, '%'+@ProductName+ '%'))
	AND ( isnull(DP.MakeID ,0) = IIF(@MakeID IS NULL OR @MakeID = 0,isnull(DP.MakeID ,0) , @MakeID))

	ORDER BY  DP.ProductID  DESC

END
GO
