CREATE PROCEDURE [dbo].[SP_GetProductsListForWebsite]    -- [dbo].[SP_GetProductsListForWebsite]   0 , 0 , 0 , 2
(

  @MakeID INT = 0,
  @ModelID INT = 0 ,
  @LocationID INT = 0 ,
  @ColorID INT = 0 
)
AS
BEGIN
	
	SELECT DISTINCT DP.* , MK.MakeName , MD.ModelName, CLR.ColorName , CL.LocationName, FT.FuelType, TS.Seats
	FROM Products DP
	LEFT JOIN Makes MK ON DP.MakeID=MK.MakeID
	LEFT JOIN Models MD ON DP.ModelID=MD.ModelID
	LEFT JOIN CarsLocations CL ON DP.LocationID=CL.LocationID
	LEFT JOIN Colors CLR ON DP.ColorID=CLR.ColorID
	LEFT JOIN FuelTypes FT ON DP.FuelTypeID=FT.FuelTypeID
	LEFT JOIN TotalSeats TS ON DP.SeatNumberID=TS.SeatNumberID

	WHERE  DP.IsActive=1
	AND	(isnull(DP.MakeID,0)  = IIF(@MakeID IS NULL OR @MakeID = 0, isnull(DP.MakeID,0)  , @MakeID))
	AND	(isnull(DP.ModelID ,0 )= IIF(@ModelID IS NULL OR @ModelID = 0,isnull(DP.ModelID ,0 ), @ModelID))
	AND	(isnull(DP.LocationID ,0 )= IIF(@LocationID IS NULL OR @LocationID = 0,isnull(DP.LocationID ,0 ), @LocationID))
	AND	(isnull(DP.ColorID ,0 )= IIF(@ColorID IS NULL OR @ColorID = 0,isnull(DP.ColorID ,0 ), @ColorID))
	
	ORDER BY  DP.ProductID  DESC

END
GO
