CREATE PROCEDURE [dbo].[SP_InsertUpdateProduct]   
(
	@ProductID INT = NULL,
 @ProductName NVARCHAR(200),
 @Description  NVARCHAR(1000),
@SizeID INT =1, 
@CategoryID INT =1, 
@MakeID INT =0, 
@ModelID INT =0, 
@ColorID INT =0, 

@LocationID INT =0,
@EnginePowerID INT =0,
@SeatNumberID INT =0 ,
@FuelTypeID INT =0,
@TransmissionID INT =0,
@ProductYear NVARCHAR(50)=NULL,
@IsActive BIT=1,
@ShowOnHomePage BIT= 0,
@Price int,
@DisplaySeqNo INT=0, 
@ProductImage VARBINARY(MAX)=NULL, 
@DataOperationType INT


)
AS
BEGIN
	
	


	IF(@DataOperationType=1)
	BEGIN

	INSERT INTO Products(	ProductName	,Description,	SizeID, CategoryID , MakeID, ModelID, ColorID,LocationID, EnginePowerID, SeatNumberID, FuelTypeID, TransmissionID, ProductYear   ,	IsActive,	ShowOnHomePage, price ,	DisplaySeqNo,	ProductImage,	CreatedOn,	CreatedBy)
	VALUES(@ProductName	,@Description,	@SizeID,	@CategoryID ,@MakeID, @ModelID, @ColorID, @LocationID, @EnginePowerID, @SeatNumberID, @FuelTypeID, @TransmissionID , @ProductYear   , @IsActive,	@ShowOnHomePage,   @Price,	@DisplaySeqNo,	@ProductImage,	GETDATE(),	1);

	END

	ELSE IF(@ProductID IS NOT NULL AND @ProductID>0)

	BEGIN

	Declare @ProductImageNvarhcar nvarchar(max);
	set @ProductImageNvarhcar=(select convert(varchar(max),@ProductImage,0) as v1)

		IF(@ProductImage IS NULL or @ProductImageNvarhcar='0x00' or @ProductImageNvarhcar='')
		BEGIN
			SET @ProductImage = (SELECT TOP(1) ProductImage from Products where ProductID=@ProductID)
		END

		UPDATE TOP(1) Products
		SET  ProductName=@ProductName	,Description=@Description,	SizeID=@SizeID,	CategoryID=@CategoryID  ,MakeID=@MakeID, ModelID=@ModelID, ColorID=@ColorID,
		LocationID=@LocationID, EnginePowerID=@EnginePowerID, SeatNumberID=@SeatNumberID, FuelTypeID=@FuelTypeID, TransmissionID=@TransmissionID, ProductYear=@ProductYear,
		IsActive=@IsActive,	ShowOnHomePage=@ShowOnHomePage,  Price=@Price   ,	DisplaySeqNo=@DisplaySeqNo,	ProductImage=@ProductImage,	ModifiedOn=GETDATE(),	ModifiedBy=1

		WHERE ProductID=@ProductID 
	END

END
GO
