CREATE PROCEDURE [dbo].[SP_PlaceCustomerOrder]   
(
 @CustomerID INT,
 @CustomerFullName NVARCHAR(150)='', 
 @CustomerEmail  NVARCHAR(150)='',
 @CustomerPhone  NVARCHAR(150),
 @CustomerAddress   NVARCHAR(150),
@recordValueJson NVARCHAR(MAX)
)
AS
BEGIN
	DECLARE @OrderID INT  , @TotalAmount decimal(18,2);


	INSERT INTO Orders(CustomerFullName, CustomerID	,CustomerEmail,	CustomerPhone,	CustomerAddress	,DeliveryDate	,	CreatedOn)
	VALUES(@CustomerFullName, @CustomerID ,	@CustomerEmail,	@CustomerPhone,	@CustomerAddress,	GETDATE(),		GETDATE());
	set @OrderID = SCOPE_IDENTITY();

	INSERT INTO OrdersDetail(OrderID,	ProductID,	Quantity,	Price,	CreatedOn)
				SELECT @OrderID,	ProductID,	1,	Price, getdate()
				FROM OPENJSON(@recordValueJson)
				WITH ( 
				ProductID int  '$.ProductID', 
				Price decimal(18,2) '$.Price' 
				)

	SET @TotalAmount=(SELECT SUM(ISNULL(Price,0)) FROM OrdersDetail WHERE OrderID=@OrderID)

	UPDATE ORDERS SET TotalAmount=@TotalAmount WHERE OrderID=@OrderID

	-- update status
	insert into OrderStatuses(OrderID, StatusID, IsActive)values(@OrderID, 1 , 1);

	--insert notificatoins
	insert into Notifications(Message, CreatedOn)
	values('New order: ' +SPACE(1)+ cast(@OrderID as nvarchar) + SPACE(1) + 'placed by customer: ' + space(1) + @CustomerFullName ,getdate());

	SELECT TOP 1 ORD.*, 'Saved Successfully!' as ResponseMsg FROM Orders ORD WHERE  OrderID=@OrderID


END
GO
